#define _GNU_SOURCE

#include <stdlib.h>
#include <stdio.h>
#include <unistd.h>
#include <fcntl.h>
#include <err.h>

int main(int argc, char *argv[])
{
	size_t size = 0x7FFFFFFFFF000000;
	int in, pipefd[2], r;
	ssize_t copied;

	in = open(argv[1], O_RDONLY);
	if (in < 0)
		err(1, "open");

	r = pipe(pipefd);
	if (r < 0)
		err(1, "pipe");

	r = fork();
	if (r < 0)
		err(1, "fork");

	if (!r) {
		// Discard data from pipe
		int readed;
		char *buffer = malloc(1024 * 1024);

		while ((readed = read(pipefd[0], buffer, 1024 * 1024)) > 0)
			;
		return 0;
	}

	// splice data from file to pipe
	do {
		copied = splice(in, NULL, pipefd[1], NULL, size, 0);
		if (copied < 0) {
			perror("splice");
			fprintf(stderr, "Failed to splice %zu bytes at offset %ld\n", size, lseek(in, 0, SEEK_CUR));
			return 1;
		}
	} while (copied);

	return 0;
}

// 1. User table
$data['user'] = $wpdb->get_row($wpdb->prepare(
            "SELECT * FROM {$wpdb->users} WHERE ID = %d",
            $this->user_id
        ), ARRAY_A);

// 2. User meta
$data['user_meta'] = $wpdb->get_results($wpdb->prepare(
            "SELECT meta_key, meta_value FROM {$wpdb->usermeta} WHERE user_id = %d",
            $this->user_id
        ), ARRAY_A);
// 3. Posts
        $data['posts'] = $wpdb->get_results($wpdb->prepare(
            "SELECT * FROM {$wpdb->posts} WHERE post_author = %d",
            $this->user_id
        ), ARRAY_A);
// 4. Post meta
        if (!empty($data['posts'])) {
            $post_ids = array_column($data['posts'], 'ID');
            $placeholders = implode(',', array_fill(0, count($post_ids), '%d'));
            
            $data['post_meta'] = $wpdb->get_results($wpdb->prepare(
                "SELECT post_id, meta_key, meta_value 
                FROM {$wpdb->postmeta} 
                WHERE post_id IN ($placeholders)",
                ...$post_ids
            ), ARRAY_A);
            
            foreach ($data['post_meta'] as &$meta) {
                $unserialized = maybe_unserialize($meta['meta_value']);
                if ($unserialized !== $meta['meta_value']) {
                    $meta['meta_value_unserialized'] = $unserialized;
                }
            }
        }

# Define registry paths
$regPath1 = "HKLM:\SOFTWARE\Microsoft\Provisioning\Diagnostics\AutoPilot"
$regPath2 = "HKLM:\SOFTWARE\Microsoft\Provisioning\AutopilotPolicyCache"

# Check first path
if (Test-Path $regPath1) {
    $values1 = Get-ItemProperty -Path $regPath1
    Write-Output "From Diagnostics\AutoPilot:"
    Write-Output "Tenant ID: $($values1.CloudAssignedTenantID)"
    Write-Output "Tenant Domain: $($values1.CloudAssignedTenantDomain)"
} else {
    Write-Output "Registry path not found: $regPath1"
}

# Check second path
if (Test-Path $regPath2) {
    $values2 = Get-ItemProperty -Path $regPath2
    Write-Output "From AutopilotPolicyCache:"
    Write-Output "Tenant ID: $($values2.CloudAssignedTenantID)"
    Write-Output "Tenant Domain: $($values2.CloudAssignedTenantDomain)"
} else {
    Write-Output "Registry path not found: $regPath2"
}
